import React from 'react';
import { Navbar,NavItem } from 'react-bootstrap';
function Appbar(){
    return(
        <div>
            <div>
            <h1>Library Management</h1>
            </div>
            <Navbar>
                <NavItem eventKey={1} href="#" padding="200">Home</NavItem>
                <NavItem eventKey={1} href="#" padding="200">contact</NavItem>
            </Navbar>
        </div>
    );
}
export default Appbar;
